    false,nt"url": null,nt"notes": "SUMMARY: We, the U.S. Fish and Wildlife
    Service (Service), designate critical habitat pursuant to the Endangered Species
    Act of 1973, as amended (Act), for 99 of the 101 species known historically from
    the Hawaiian island of Oahu. This critical habitat designation requires the Service
    to consult under section 7 of the Act with regard to actions carried out, funded,
    or authorized by a Federal agency. Section 4 of the Act requires us to consider
    economic and other relevant impacts when specifying any particular area as critical
    habitat. This rule also determines that designating critical habitat would not be
    prudent for two species (Cyrtandra crenata and Pritchardia kaalae). We solicited
    data and comments from the public on all aspects of the proposed rule, including
    data on economic and other impacts of the designation.",nt"license_title":
